如果直接安装会提示以下问题 Error
TrueCrypt requires Mac OS X 10.4 or later. 解决方法如下 双击 TrueCrypt 7.1a Mac OS X.dmg 文件，会出现 TrueCrypt 7.1a.mpkg 文件 将其复制到某个目录中 右键 TrueCrypt 7.1a.mpkg 文件选择 "Show Package Contents", 然后进入 Contents 文件，编辑这个文件 distribution.dist 将其中的如下代码 function pm_install_check() { if(!(system.version.ProductVersion >= '10.4.0')) { my.result.title = 'Error'; my.result.message = 'TrueCrypt requires Mac OS X 10.4 or later.'; my.result.type = 'Fatal'; return false; } return true;
} 改为 function pm_install_check() { return true;
} 双击修改过的 TrueCrypt 7.1a.mpkg 文件，就可以安装了

