比较简单的做法，就是通过修改 TOR 的配置文件，规避这些不安全国家的节点 对于天朝的网友，你至少需要屏蔽「大陆、香港、澳门」这三个节点 因为这三个地区都可能被六扇门设置蜜罐 打开 TOR 的配置文件 torrc（在系统盘搜索就可找到），在末尾加入 ExcludeNodes {cn},{hk},{mo},{kp},{ir},{sy},{pk},{cu},{vn}
strictnodes 1 代表的国家分别为 大陆 {cn}
香港 {hk}
澳门 {mo}
北朝鲜 {kp}
伊朗 {ir}
叙利亚 {sy}
巴基斯坦 {pk}
古巴 {cu}
越南 {vn} 关于 strictnode, 补充说明一下： 如果不设置 strictnode 1, TOR 客户端首先也会规避 ExcludeNodes 列出的这些国家。 但如果 TOR 客户端找不到可用的线路，就会去尝试位于排除列表中的节点 如果设置了 strictnode 1, 即使 TOR 客户端找不到可用的线路，也不会去尝试这些国家的节点
